class ApiService {
    static async getTopGainersLosers() {
      const apiKey = 'JH59KR1EHBJDXW6T'; // Replace 'your_api_key_here' with your actual API key
      const url = `https://www.alphavantage.co/query?function=TOP_GAINERS_LOSERS&apikey=${apiKey}`;

      try {
        const response = await fetch(url);
        const data = await response.json();
        // Parse the response data to extract the top gainers and losers information
        const topGainers = data["Stock Quotes"].filter(stock => stock["10. change percent"].includes("+"));
        const topLosers = data["Stock Quotes"].filter(stock => stock["10. change percent"].includes("-"));

        return { topGainers, topLosers };
      } catch (error) {
        throw new Error('Error fetching top gainers and losers data');
      }
    }
  }

  export default ApiService;
